import React from 'react'
import { useTranslation } from 'react-i18next'

const TaxYear = () => {

    const { t } = useTranslation()

    return (
        <div>
            {t("taxyear.label")}: <select name='TaxYear'><input value='2020'>2020</input><input value='2019'>2019</input><input value='2018'>2018</input></select>
        </div>
    )

}

export default TaxYear
